import React, {useRef} from 'react';


const Bunny = () => {

    const canvas = useRef(null);

    const app = new PIXI.Application({
        view: canvas,
        width: 300,
        height: 300
    })


    return (
        <div>
            <canvas ref={canvas} />
        </div>
    )
}

export default Bunny;
